import React from "react";
import {
	FormControl,
	InputLabel,
	MenuItem
} from "@material-ui/core";
import MuiSelect from "@material-ui/core/Select";
import { createStyles, makeStyles, Theme } from "@material-ui/core/styles";
import * as WORD_TYPES from "../../../store/WordTypes/WordTypes";

const useStyles = makeStyles((theme: Theme) =>
	createStyles({
		formControl: {
			marginBottom: theme.spacing(1),
			minWidth: 90,
			textAlign: 'left',
		},
		selectEmpty: {
			marginTop: theme.spacing(1),
		},
	}),
);

function WordType() {
	const classes = useStyles();
	const [POS, setPOS] = React.useState('');

	const handleChange = (event: React.ChangeEvent<{ value: unknown }>) => {
		setPOS(event.target.value as string);
	};

	return (
		<FormControl variant="standard" size="small" className={classes.formControl}>
			<InputLabel id="demo-simple-select-outlined-label">POS</InputLabel>
			<MuiSelect
				labelId="demo-simple-select-outlined-label"
				id="demo-simple-select-outlined"
				value={POS}
				onChange={handleChange}
				label="Part of Speech"
			>
					{WORD_TYPES.TYPES.map((wordType: string) => <MenuItem key={index} value={wordType}>{wordType}</MenuItem>)}
			</MuiSelect>
		</FormControl>
	);
}

export default WordType;
